import React from 'react';
import { ListGroup, ListGroupItem } from 'reactstrap';
import linkList from "./modals"


function DisplayLink() {
console.log("LinkList", linkList)
let arr = linkList


         return (
            <ListGroup>
             {arr.map((data, index) => {
                return (
                <ListGroupItem key={index}>
                    <a href={data}>{data}</a>
                </ListGroupItem>
                )

             })}
            </ListGroup>
         )
}

export default DisplayLink;
